import React from 'react'

function Icon() {
  return (
    <div>

     
        {/* ============================================================== */}
        {/* Preloader - style you can find in spinners.css */}
        {/* ============================================================== */}
        <div className="preloader">
          <div className="lds-ripple">
            <div className="lds-pos" />
            <div className="lds-pos" />
          </div>
        </div>
        {/* ============================================================== */}
        {/* Main wrapper - style you can find in pages.scss */}
        {/* ============================================================== */}
        <div id="main-wrapper" data-layout="vertical" data-navbarbg="skin5" data-sidebartype="full" data-sidebar-position="absolute" data-header-position="absolute" data-boxed-layout="full">
          {/* ============================================================== */}
          {/* Topbar header - style you can find in pages.scss */}
          {/* ============================================================== */}
          <header className="topbar" data-navbarbg="skin5">
            <nav className="navbar top-navbar navbar-expand-md navbar-dark">
              <div className="navbar-header" data-logobg="skin5">
                {/* ============================================================== */}
                {/* Logo */}
                {/* ============================================================== */}
                <a className="navbar-brand" href="index.html">
                  {/* Logo icon */}
                  <b className="logo-icon">
                    {/*You can put here icon as well // <i class="wi wi-sunset"></i> //*/}
                    {/* Dark Logo icon */}
                    <img src="../../assets/images/logo-icon.png" alt="homepage" className="dark-logo" />
                    {/* Light Logo icon */}
                    <img src="../../assets/images/logo-light-icon.png" alt="homepage" className="light-logo" />
                  </b>
                  {/*End Logo icon */}
                  {/* Logo text */}
                  <span className="logo-text">
                    {/* dark Logo text */}
                    <img src="../../assets/images/logo-text.png" alt="homepage" className="dark-logo" />
                    {/* Light Logo text */}
                    <img src="../../assets/images/logo-light-text.png" className="light-logo" alt="homepage" />
                  </span>
                </a>
                {/* ============================================================== */}
                {/* End Logo */}
                {/* ============================================================== */}
                {/* This is for the sidebar toggle which is visible on mobile only */}
                <a className="nav-toggler waves-effect waves-light d-block d-md-none" href="javascript:void(0)"><i className="ti-menu ti-close" /></a>
              </div>
              {/* ============================================================== */}
              {/* End Logo */}
              {/* ============================================================== */}
              <div className="navbar-collapse collapse" id="navbarSupportedContent" data-navbarbg="skin5">
                {/* ============================================================== */}
                {/* toggle and nav items */}
                {/* ============================================================== */}
                <ul className="navbar-nav float-start me-auto">
                  {/* ============================================================== */}
                  {/* Search */}
                  {/* ============================================================== */}
                  <li className="nav-item search-box"> <a className="nav-link waves-effect waves-dark" href="javascript:void(0)"><i className="ti-search" /></a>
                    <form className="app-search position-absolute">
                      <input type="text" className="form-control" placeholder="Search & enter" /> <a className="srh-btn"><i className="ti-close" /></a>
                    </form>
                  </li>
                </ul>
                {/* ============================================================== */}
                {/* Right side toggle and nav items */}
                {/* ============================================================== */}
                <ul className="navbar-nav float-end">
                  {/* ============================================================== */}
                  {/* User profile and search */}
                  {/* ============================================================== */}
                  <li className="nav-item dropdown">
                    <a className="nav-link dropdown-toggle text-muted waves-effect waves-dark pro-pic" href="#" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                      <img src="../../assets/images/users/1.jpg" alt="user" className="rounded-circle" width={31} />
                    </a>
                    <ul className="dropdown-menu dropdown-menu-end user-dd animated" aria-labelledby="navbarDropdown">
                      <a className="dropdown-item" href="javascript:void(0)"><i className="ti-user m-r-5 m-l-5" />
                        My Profile</a>
                      <a className="dropdown-item" href="javascript:void(0)"><i className="ti-wallet m-r-5 m-l-5" />
                        My Balance</a>
                      <a className="dropdown-item" href="javascript:void(0)"><i className="ti-email m-r-5 m-l-5" />
                        Inbox</a>
                    </ul>
                  </li>
                  {/* ============================================================== */}
                  {/* User profile and search */}
                  {/* ============================================================== */}
                </ul>
              </div>
            </nav>
          </header>
          {/* ============================================================== */}
          {/* End Topbar header */}
          {/* ============================================================== */}
          {/* ============================================================== */}
          {/* Left Sidebar - style you can find in sidebar.scss  */}
          {/* ============================================================== */}
          <aside className="left-sidebar" data-sidebarbg="skin6">
            {/* Sidebar scroll*/}
            <div className="scroll-sidebar">
              {/* Sidebar navigation*/}
              <nav className="sidebar-nav">
                <ul id="sidebarnav">
                  {/* User Profile*/}
                  <li>
                    {/* User Profile*/}
                    <div className="user-profile d-flex no-block dropdown m-t-20">
                      <div className="user-pic"><img src="../../assets/images/users/1.jpg" alt="users" className="rounded-circle" width={40} /></div>
                      <div className="user-content hide-menu m-l-10">
                        <a href="#" className id="Userdd" role="button" data-bs-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                          <h5 className="m-b-0 user-name font-medium">Steave Jobs <i className="fa fa-angle-down" /></h5>
                          <span className="op-5 user-email">varun@gmail.com</span>
                        </a>
                        <div className="dropdown-menu dropdown-menu-end" aria-labelledby="Userdd">
                          <a className="dropdown-item" href="javascript:void(0)"><i className="ti-user m-r-5 m-l-5" /> My Profile</a>
                          <a className="dropdown-item" href="javascript:void(0)"><i className="ti-wallet m-r-5 m-l-5" /> My Balance</a>
                          <a className="dropdown-item" href="javascript:void(0)"><i className="ti-email m-r-5 m-l-5" /> Inbox</a>
                          <div className="dropdown-divider" />
                          <a className="dropdown-item" href="javascript:void(0)"><i className="ti-settings m-r-5 m-l-5" /> Account Setting</a>
                          <div className="dropdown-divider" />
                          <a className="dropdown-item" href="javascript:void(0)"><i className="fa fa-power-off m-r-5 m-l-5" /> Logout</a>
                        </div>
                      </div>
                    </div>
                    {/* End User Profile*/}
                  </li>
                  <li className="p-15 m-t-10"><a href="javascript:void(0)" className="btn d-block w-100 create-btn text-white no-block d-flex align-items-center"><i className="fa fa-plus-square" /> <span className="hide-menu m-l-5">Create New</span> </a>
                  </li>
                  {/* User Profile*/}
                  <li className="sidebar-item"> <a className="sidebar-link waves-effect waves-dark sidebar-link" href="index.html" aria-expanded="false"><i className="mdi mdi-view-dashboard" /><span className="hide-menu">Dashboard</span></a></li>
                  <li className="sidebar-item"> <a className="sidebar-link waves-effect waves-dark sidebar-link" href="pages-profile.html" aria-expanded="false"><i className="mdi mdi-account-network" /><span className="hide-menu">Profile</span></a></li>
                  <li className="sidebar-item"> <a className="sidebar-link waves-effect waves-dark sidebar-link" href="table-basic.html" aria-expanded="false"><i className="mdi mdi-border-all" /><span className="hide-menu">Table</span></a></li>
                  <li className="sidebar-item"> <a className="sidebar-link waves-effect waves-dark sidebar-link" href="icon-material.html" aria-expanded="false"><i className="mdi mdi-face" /><span className="hide-menu">Icon</span></a></li>
                  <li className="sidebar-item"> <a className="sidebar-link waves-effect waves-dark sidebar-link" href="starter-kit.html" aria-expanded="false"><i className="mdi mdi-file" /><span className="hide-menu">Blank</span></a></li>
                  <li className="sidebar-item"> <a className="sidebar-link waves-effect waves-dark sidebar-link" href="error-404.html" aria-expanded="false"><i className="mdi mdi-alert-outline" /><span className="hide-menu">404</span></a></li>
                  <li className="text-center p-40 upgrade-btn">
                    <a href="https://www.wrappixel.com/templates/xtremeadmin/" className="btn d-block w-100 btn-danger text-white" target="_blank">Upgrade to Pro</a>
                  </li>
                </ul>
              </nav>
              {/* End Sidebar navigation */}
            </div>
            {/* End Sidebar scroll*/}
          </aside>
          {/* ============================================================== */}
          {/* End Left Sidebar - style you can find in sidebar.scss  */}
          {/* ============================================================== */}
          {/* ============================================================== */}
          {/* Page wrapper  */}
          {/* ============================================================== */}
          <div className="page-wrapper">
            {/* ============================================================== */}
            {/* Bread crumb and right sidebar toggle */}
            {/* ============================================================== */}
            <div className="page-breadcrumb">
              <div className="row align-items-center">
                <div className="col-5">
                  <h4 className="page-title">Material Icon </h4>
                  <div className="d-flex align-items-center">
                    <nav aria-label="breadcrumb">
                      <ol className="breadcrumb">
                        <li className="breadcrumb-item"><a href="#">Home</a></li>
                        <li className="breadcrumb-item active" aria-current="page">Library</li>
                      </ol>
                    </nav>
                  </div>
                </div>
                <div className="col-7">
                  <div className="text-end upgrade-btn">
                    <a href="https://www.wrappixel.com/templates/xtremeadmin/" className="btn btn-danger text-white" target="_blank">Upgrade to Pro</a>
                  </div>
                </div>
              </div>
            </div>
            {/* ============================================================== */}
            {/* End Bread crumb and right sidebar toggle */}
            {/* ============================================================== */}
            {/* ============================================================== */}
            {/* Container fluid  */}
            {/* ============================================================== */}
            <div className="container-fluid">
              {/* ============================================================== */}
              {/* Start Page Content */}
              {/* ============================================================== */}
              <div className="row">
                <div className="col-12">
                  <div className="card">
                    <div className="card-body">
                      <h4 className="card-title">Material Icons</h4>
                      <h6 className="card-subtitle">you can use any icon with class of <code className="m-r-10">mid mid-</code>name of icon</h6>
                      <div className="material-icon-list-demo">
                        <div className="row icons" id="icons">
                          <div className="m-icon"><i className="m-r-10 mdi mdi-access-point" /><code className="m-r-10">f002</code><span>mdi-access-point</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-access-point-network" /><code className="m-r-10">f003</code><span>mdi-access-point-network</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account" /><code className="m-r-10">f004</code><span>mdi-account</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-alert" /><code className="m-r-10">f005</code><span>mdi-account-alert</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-box" /><code className="m-r-10">f006</code><span>mdi-account-box</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-box-outline" /><code className="m-r-10">f007</code><span>mdi-account-box-outline</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-card-details" /><code className="m-r-10">f5d2</code><span>mdi-account-card-details</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-check" /><code className="m-r-10">f008</code><span>mdi-account-check</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-circle" /><code className="m-r-10">f009</code><span>mdi-account-circle</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-convert" /><code className="m-r-10">f00a</code><span>mdi-account-convert</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-edit" /><code className="m-r-10">f6bb</code><span>mdi-account-edit</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-key" /><code className="m-r-10">f00b</code><span>mdi-account-key</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-location" /><code className="m-r-10">f00c</code><span>mdi-account-location</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-minus" /><code className="m-r-10">f00d</code><span>mdi-account-minus</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-multiple" /><code className="m-r-10">f00e</code><span>mdi-account-multiple</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-multiple-minus" /><code className="m-r-10">f5d3</code><span>mdi-account-multiple-minus</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-multiple-outline" /><code className="m-r-10">f00f</code><span>mdi-account-multiple-outline</span>
                          </div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-multiple-plus" /><code className="m-r-10">f010</code><span>mdi-account-multiple-plus</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-network" /><code className="m-r-10">f011</code><span>mdi-account-network</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-off" /><code className="m-r-10">f012</code><span>mdi-account-off</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-outline" /><code className="m-r-10">f013</code><span>mdi-account-outline</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-plus" /><code className="m-r-10">f014</code><span>mdi-account-plus</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-remove" /><code className="m-r-10">f015</code><span>mdi-account-remove</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-search" /><code className="m-r-10">f016</code><span>mdi-account-search</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-settings" /><code className="m-r-10">f630</code><span>mdi-account-settings</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-settings-variant" /><code className="m-r-10">f631</code><span>mdi-account-settings-variant</span>
                          </div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-star" /><code className="m-r-10">f017</code><span>mdi-account-star</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-star-variant" /><code className="m-r-10">f018</code><span>mdi-account-star-variant</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-account-switch" /><code className="m-r-10">f019</code><span>mdi-account-switch</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-adjust" /><code className="m-r-10">f01a</code><span>mdi-adjust</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-air-conditioner" /><code className="m-r-10">f01b</code><span>mdi-air-conditioner</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-airballoon" /><code className="m-r-10">f01c</code><span>mdi-airballoon</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-airplane" /><code className="m-r-10">f01d</code><span>mdi-airplane</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-airplane-landing" /><code className="m-r-10">f5d4</code><span>mdi-airplane-landing</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-airplane-off" /><code className="m-r-10">f01e</code><span>mdi-airplane-off</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-airplane-takeoff" /><code className="m-r-10">f5d5</code><span>mdi-airplane-takeoff</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-airplay" /><code className="m-r-10">f01f</code><span>mdi-airplay</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-alarm" /><code className="m-r-10">f020</code><span>mdi-alarm</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-alarm-check" /><code className="m-r-10">f021</code><span>mdi-alarm-check</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-alarm-multiple" /><code className="m-r-10">f022</code><span>mdi-alarm-multiple</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-alarm-off" /><code className="m-r-10">f023</code><span>mdi-alarm-off</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-alarm-plus" /><code className="m-r-10">f024</code><span>mdi-alarm-plus</span></div>
                          <div className="m-icon"><i className="m-r-10 mdi mdi-alarm-snooze" /><code className="m-r-10">f68d</code><span>mdi-alarm-snooze</span></div>
